// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./token.sol";
import "hardhat/console.sol";

contract TokenExchange is Ownable {
    string public exchange_name = "";

    address tokenAddr = 0x5FbDB2315678afecb367f032d93F642f64180aa3;
    Token public token = Token(tokenAddr);

    // Liquidity pool for the exchange
    uint private token_reserves = 0;
    uint private eth_reserves = 0;

    // Fee Pools
    uint private token_fee_reserves = 0;
    uint private eth_fee_reserves = 0;

    // Liquidity pool shares
    mapping(address => uint) private lps;

    // For Extra Credit only: to loop through the keys of the lps mapping
    address[] private lp_providers;

    // Total Pool Shares
    uint private total_shares = 0;

    // liquidity rewards
    uint private swap_fee_numerator = 3;
    uint private swap_fee_denominator = 100;

    // Constant: x * y = k
    uint private k;

    // For use with exchange rates
    uint private multiplier = 10 ** 5;

    uint private ten_to_eighteen = 10 ** 18;

    constructor() {}

    // Function createPool: Initializes a liquidity pool between your Token and ETH.
    // ETH will be sent to pool in this transaction as msg.value
    // amountTokens specifies the amount of tokens to transfer from the liquidity provider.
    // Sets up the initial exchange rate for the pool by setting amount of token and amount of ETH.
    function createPool(uint amountTokens) external payable onlyOwner {
        // This function is already implemented for you; no changes needed.

        // require pool does not yet exist:
        require(token_reserves == 0, "Token reserves was not 0");
        require(eth_reserves == 0, "ETH reserves was not 0.");

        // require nonzero values were sent
        require(msg.value > 0, "Need eth to create pool.");
        uint tokenSupply = token.balanceOf(msg.sender);
        require(
            amountTokens <= tokenSupply,
            "Not have enough tokens to create the pool"
        );
        require(amountTokens > 0, "Need tokens to create pool.");
        token.transferFrom(msg.sender, address(this), amountTokens);
        token_reserves = token.balanceOf(address(this));
        eth_reserves = msg.value;
        k = token_reserves * eth_reserves;

        // Pool shares set to a large value to minimize round-off errors
        total_shares = 10 ** 5;
        // Pool creator has some low amount of shares to allow autograder to run
        lps[msg.sender] = 100;
    }

    // For use for ExtraCredit ONLY
    // Function removeLP: removes a liquidity provider from the list.
    // This function also removes the gap left over from simply running "delete".
    function removeLP(uint index) private {
        require(
            index < lp_providers.length,
            "specified index is larger than the number of lps"
        );
        lp_providers[index] = lp_providers[lp_providers.length - 1];
        lp_providers.pop();
    }

    // Function getSwapFee: Returns the current swap fee ratio to the client.
    function getSwapFee() public view returns (uint, uint) {
        return (swap_fee_numerator, swap_fee_denominator);
    }

    // ============================================================
    //                    FUNCTIONS TO IMPLEMENT
    // ============================================================

    /* ========================= Liquidity Provider Functions =========================  */
    //y is token and x is eth
    // Function addLiquidity: Adds liquidity given a supply of ETH (sent to the contract as msg.value).
    // You can change the inputs, or the scope of your function, as needed.
    function addLiquidity(
        uint max_exchange_rate,
        uint min_exchange_rate
    ) external payable {
        require(msg.value > 0, "must add nonzero amount");
        uint new_total_shares = (((msg.value + eth_reserves) * total_shares) /
            eth_reserves);

        uint new_total_eth = msg.value + eth_reserves;
        uint alice_shares = (msg.value * new_total_shares) / new_total_eth;
        // check to see if this should be a fraction or the total amount of shares
        lps[msg.sender] += alice_shares;
        uint delta_y = (msg.value * token_reserves) / eth_reserves;

        uint exchange_rate_recieved = (delta_y * ten_to_eighteen) /
            (msg.value / multiplier);

        require(
            exchange_rate_recieved > min_exchange_rate,
            "less than min exchange rate"
        );
        require(
            exchange_rate_recieved < max_exchange_rate,
            "more than max exhange rate"
        );
        require(
            delta_y <= token.balanceOf(msg.sender),
            "User doesn't have enough tokens"
        );

        token_reserves += delta_y;
        eth_reserves += msg.value;

        //sending token
        token.transferFrom(msg.sender, address(this), delta_y);
        total_shares = new_total_shares;
        k = address(this).balance * token.balanceOf(address(this));
    }

    // Function removeLiquidity: Removes liquidity given the desired amount of ETH to remove.
    // You can change the inputs, or the scope of your function, as needed.
    function removeLiquidity(
        uint amountETH,
        uint max_exchange_rate,
        uint min_exchange_rate
    ) public payable {
        require(
            amountETH <= eth_reserves - 1,
            "Can't withdraw more ETH than exists"
        );

        uint new_total_shares = ((eth_reserves - amountETH) * total_shares) /
            eth_reserves;
        uint new_total_eth = eth_reserves - amountETH;
        uint alice_less_shares = (amountETH * new_total_shares) / new_total_eth;

        // calculate the amount of fees which have been accumulated
        uint extra_eth = address(this).balance - eth_reserves;
        uint extra_tokens = token.balanceOf(address(this)) - token_reserves;

        // calculate amount of tokens to be sent
        uint delta_y = (amountETH * token_reserves) / eth_reserves;
        uint exchange_rate_recieved = (token_reserves * ten_to_eighteen) /
            (eth_reserves / multiplier);
        require(
            exchange_rate_recieved > min_exchange_rate,
            "less than min exchange rate"
        );
        require(
            exchange_rate_recieved < max_exchange_rate,
            "more than max exhange rate"
        );
        require(delta_y <= token_reserves, "Not enough tokens to withdraw");

        token_reserves -= (delta_y);
        eth_reserves -= amountETH;

        address payable lp = payable(msg.sender);
        (bool sent, ) = lp.call{
            value: amountETH + (alice_less_shares * extra_eth) / total_shares
        }("");
        require(sent, "Failed to send Ether");
        bool tok_sent = token.transfer(
            msg.sender,
            delta_y + (alice_less_shares * extra_tokens) / total_shares
        );
        require(tok_sent, "tokens were not sent");
        lps[msg.sender] -= alice_less_shares;
        k = address(this).balance * token.balanceOf(address(this));
        total_shares = new_total_shares;
    }

    // Function removeAllLiquidity: Removes all liquidity that msg.sender is entitled to withdraw
    // You can change the inputs, or the scope of your function, as needed.
    function removeAllLiquidity(
        uint max_exchange_rate,
        uint min_exchange_rate
    ) external payable {
        uint sh = lps[msg.sender];
        uint eth_owed = (sh * eth_reserves) / total_shares;
        removeLiquidity(eth_owed, max_exchange_rate, min_exchange_rate);
    }

    /* ========================= Swap Functions =========================  */

    // Function swapTokensForETH: Swaps your token with ETH
    // You can change the inputs, or the scope of your function, as needed.
    function swapTokensForETH(
        uint amountTokens,
        uint max_exchange_rate
    ) external payable {
        require(
            token.balanceOf(msg.sender) >= amountTokens,
            "sender doesn't have sufficient tokens"
        );

        uint256 eth_due = (amountTokens * eth_reserves) /
            (token_reserves + amountTokens);
        //fee adjusted eth to give and token to add
        uint eth_to_give = eth_due -
            (eth_due * swap_fee_numerator) /
            swap_fee_denominator;
        uint token_to_add = amountTokens -
            (amountTokens * swap_fee_numerator) /
            swap_fee_denominator;
        require(
            eth_due / (amountTokens * multiplier * ten_to_eighteen) <
                max_exchange_rate,
            "more than max exchange rate"
        );
        require(eth_due <= eth_reserves - 1, "Can't get rid of all eth");
        token_reserves += token_to_add;
        eth_reserves -= eth_to_give;
        address payable lp = payable(msg.sender);
        (bool sent, ) = lp.call{value: eth_to_give}("");
        require(sent, "Failed to send Ether");
        //send all tokens
        bool tok_sent = token.transferFrom(
            msg.sender,
            address(this),
            amountTokens
        );
        require(tok_sent, "tokens were not sent");
    }

    function swapETHForTokens(uint max_exchange_rate) external payable {
        require(msg.value > 0, "must give nonzero amount");

        uint256 token_due = (msg.value * token_reserves) /
            (eth_reserves + msg.value);

        require(
            (token_due * multiplier * ten_to_eighteen) / msg.value < max_exchange_rate,
            "over max exchange rate"
        );
        require(
            token_due <= token_reserves - 1,
            "Can't take out all tokens or else would need infinite eth"
        );

        uint eth_to_add = msg.value -
            (msg.value * swap_fee_numerator) /
            swap_fee_denominator;
        uint token_to_give = token_due -
            ((swap_fee_numerator * token_due) / swap_fee_denominator);
        token_reserves -= token_to_give; // add fee adjusted token to reserves
        eth_reserves += eth_to_add; // add fee adjusted eth to eth_reserves

        bool tok_sent = token.transfer(msg.sender, token_to_give); // give fee adjusted token to homie
        require(tok_sent, "tokens were not sent");
    }
}

